import { ApiResponse } from '../../../types/api-response';
import { Invite } from '../redux/types';

export function fetchAllInvites(): ApiResponse<Invite[]> {
  console.log('here!!');
  return new Promise((resolve) => {
    const payload = [
      {
        text: 'hi honey',
        id: 1,
      },
      {
        text: 'oh honey',
        id: 2,
      },
      {
        text: 'I am in your town',
        id: 3,
      },
    ];
    setTimeout(() => {
      resolve({
        payload,
        success: true,
        error: null,
      });
    }, 550);
  });
}
